import React from 'react';
import '../css/Planet.css';

const Planet = ({ name, pictureUrl, currentPopulation }) => {
    return (
        <>
            <div className="container">
                <div>
                    <img src={pictureUrl} className="img"/>
                </div>
                <p>{name}</p>
                <p>{currentPopulation}</p>
            </div>
        </>
    )
}

export default Planet;
